import React, { Component } from 'react';

class Answer extends Component {
    render() {
        return (
            <div>
                <div className="img9" style="text-align: center; display: none;">

                    <img src="number/4.jpg" className="hinh81" width="100px" height="100px "
                         style=" margin-right: 50px; margin-bottom: 50px; margin-top: 100px;"/>


                        <img src="number/3.jpg" className="hinh82" width="100px" height="100px "
                             style="margin-right: 50px; margin-bottom: 50px;"/>

                            <img src="number/9.jpg" className="hinh84" width="100px" height="100px "
                                 style="margin-right: 50px; margin-bottom: 50px;"/>
                                <a onClick="yes.play();">
                                    <img src="number/8.jpg" className="hinh83" width="100px" height="100px "
                                         style="margin-right: 50px; margin-bottom: 50px;"/>
                                </a>
                </div>
                <button className="next9"
                        style="background-color: rgb(47, 248, 255); display: none; border-radius: 10px; width: 100px; height: 50px; margin-left: 800px;">NEXT
                </button>
            </div>
        );
    }
}

export default Answer;
